import React from 'react';
import { Box, Typography, Button, Grid, Card, CardMedia, CardContent } from '@mui/material';
import { styled } from '@mui/system';
import Navbar from './/Navbar'; // Assuming your Navbar component is in a separate file
import Footer from './Footer'; // Assuming your Footer component is in a separate file

// Styled Components
const HeroSection = styled(Box)({
  backgroundImage: `url('https://images.unsplash.com/photo-1523381210434-271e8be1f52b?ixlib=rb-4.0.3&auto=format&fit=crop&w=1350&q=80')`, // Dummy hero image
  backgroundSize: 'cover',
  backgroundPosition: 'center',
  height: '80vh',
  display: 'flex',
  flexDirection: 'column',
  justifyContent: 'center',
  alignItems: 'center',
  color: '#ffffff',
  textAlign: 'center',
  padding: '0 20px',
  position: 'relative',
  '&:before': {
    content: '""',
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    backgroundColor: 'rgba(0, 0, 0, 0.5)', // Overlay for readability
  },
});

const HeroButton = styled(Button)({
  backgroundColor: '#28b463',
  color: '#ffffff',
  padding: '12px 30px',
  fontSize: '1.1rem',
  fontWeight: 'bold',
  borderRadius: '50px',
  textTransform: 'none',
  transition: 'background-color 0.3s ease, transform 0.2s ease',
  '&:hover': {
    backgroundColor: '#229954',
    transform: 'scale(1.05)',
  },
});

const Section = styled(Box)({
  padding: '60px 40px',
  backgroundColor: '#000000',
  color: '#ffffff',
});

const ProductCard = styled(Card)({
  backgroundColor: '#1a1a1a',
  color: '#ffffff',
  transition: 'transform 0.3s ease, box-shadow 0.3s ease',
  '&:hover': {
    transform: 'translateY(-10px)',
    boxShadow: '0 8px 24px rgba(40, 180, 99, 0.3)', // Green shadow on hover
  },
});

const SectionTitle = styled(Typography)({
  fontWeight: 'bold',
  fontSize: '2.5rem',
  marginBottom: '40px',
  textAlign: 'center',
  color: '#28b463',
});

// Dummy Data
const featuredProducts = [
  {
    id: 1,
    name: 'Oversized Classic Tee - Black',
    price: '₹1299',
    image: 'https://images.unsplash.com/photo-1503342217505-b0a15ec3261c?ixlib=rb-4.0.3&auto=format&fit=crop&w=500&q=60',
  },
  {
    id: 2,
    name: 'Oversized Graphic Tee - White',
    price: '₹1499',
    image: 'https://images.unsplash.com/photo-1521572163474-6864f9cf17ab?ixlib=rb-4.0.3&auto=format&fit=crop&w=500&q=60',
  },
  {
    id: 3,
    name: 'Oversized Hoodie - Grey',
    price: '₹1999',
    image: 'https://images.unsplash.com/photo-1571945153237-3b3b3f8e25da?ixlib=rb-4.0.3&auto=format&fit=crop&w=500&q=60',
  },
];

const HomePage = () => {
  return (
    <Box sx={{ backgroundColor: '#000000', minHeight: '100vh' }}>
      {/* Navbar */}
      <Navbar />

      {/* Hero Section */}
      <HeroSection>
        <Typography variant="h1" sx={{ fontSize: { xs: '2.5rem', md: '4rem' }, zIndex: 1, mb: 2 }}>
          Premium Oversized Tees
        </Typography>
        <Typography variant="h5" sx={{ zIndex: 1, mb: 4, maxWidth: '600px' }}>
          Discover comfort and style with Baa M Boo’s exclusive collection for men and women.
        </Typography>
        <HeroButton href="#shop">Shop Now</HeroButton>
      </HeroSection>

      {/* Featured Products Section */}
      <Section>
        <SectionTitle>Featured Collection</SectionTitle>
        <Grid container spacing={4} justifyContent="center">
          {featuredProducts.map((product) => (
            <Grid item xs={12} sm={6} md={4} key={product.id}>
              <ProductCard>
                <CardMedia
                  component="img"
                  height="300"
                  image={product.image}
                  alt={product.name}
                />
                <CardContent>
                  <Typography variant="h6">{product.name}</Typography>
                  <Typography variant="body1" sx={{ color: '#28b463', mt: 1 }}>
                    {product.price}
                  </Typography>
                  <Button
                    sx={{
                      mt: 2,
                      color: '#ffffff',
                      border: '1px solid #28b463',
                      '&:hover': { backgroundColor: '#28b463' },
                    }}
                  >
                    Add to Cart
                  </Button>
                </CardContent>
              </ProductCard>
            </Grid>
          ))}
        </Grid>
      </Section>

      {/* Why Choose Us Section */}
      <Section sx={{ backgroundColor: '#1a1a1a' }}>
        <SectionTitle>Why Choose Baa M Boo?</SectionTitle>
        <Grid container spacing={4} justifyContent="center">
          <Grid item xs={12} sm={6} md={3} sx={{ textAlign: 'center' }}>
            <Typography variant="h6" sx={{ mb: 1 }}>Premium Quality</Typography>
            <Typography variant="body2">
              Crafted with the finest materials for lasting comfort.
            </Typography>
          </Grid>
          <Grid item xs={12} sm={6} md={3} sx={{ textAlign: 'center' }}>
            <Typography variant="h6" sx={{ mb: 1 }}>Oversized Fit</Typography>
            <Typography variant="body2">
              Relaxed, stylish fits for every body type.
            </Typography>
          </Grid>
          <Grid item xs={12} sm={6} md={3} sx={{ textAlign: 'center' }}>
            <Typography variant="h6" sx={{ mb: 1 }}>Cash on Delivery</Typography>
            <Typography variant="body2">
              Hassle-free payments across India.
            </Typography>
          </Grid>
        </Grid>
      </Section>

      {/* Call to Action Section */}
      <Section>
        <Box sx={{ textAlign: 'center' }}>
          <Typography variant="h3" sx={{ mb: 2 }}>
            Ready to Upgrade Your Wardrobe?
          </Typography>
          <Typography variant="body1" sx={{ mb: 4, maxWidth: '500px', mx: 'auto' }}>
            Explore our collection and experience the ultimate blend of style and comfort.
          </Typography>
          <HeroButton href="#shop">Start Shopping</HeroButton>
        </Box>
      </Section>

      {/* Footer */}
      <Footer />
    </Box>
  );
};

export default HomePage;
